const MainContact = () => {
	return (
		<div>
			<div className='row'>
				<h1>Contact</h1>
				<div>
					<iframe
						width='600'
						height='450'
						frameborder='0'
						src={`https://www.google.com/maps/embed/v1/place?key=${process.env.MAP_API}&q=Space+Needle,Seattle+WA`}
						allowfullscreen
					></iframe>
					{console.log(process.env.MAP_API)}
				</div>
			</div>
		</div>
	);
};

export default MainContact;
